import { slider1, slider2, slider3 } from './sliderImports'

const sliderData = [
  {
    sliderImage: slider1
  },
  {
    id: uuidv4(),
    sliderImage: slider2
  },
  {
    id: uuidv4(),
    sliderImage: slider3
  }
];

export default sliderData;
